import React from 'react';

const CopyToClipboardText = ({ children }) => {
    const copyToClipboard = (text) => {
        navigator.clipboard.writeText(text);
    };

    return (
        <div onClick={() => copyToClipboard(children)}>
            {children}
        </div>
    );
};

export default CopyToClipboardText;
